import React from 'react'

function PageCart(props) {
    return (
        <div>
            <h1>{props.name}</h1>
            {
                props.connected ?
                    <button>Disconnect Your page</button> :
                    <button>Connect Your page</button>
            }
        </div>
    )
}

export default PageCart
